import React, { Component } 			from 'react';
import { Switch, Route, BrowserRouter } from 'react-router-dom';
import { NavLink } 						from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

import { Butt } 		from '../components/Butt';
import { Head3 } 		from '../styles/Head3';
import { Head4 } 		from '../styles/Head4';
import { FaThinkPeaks, 
		 FaThList, 
		 FaStackExchange, 
		 FaPoll} 		from 'react-icons/fa';

import Titl 			from '../components/Titl';
import AnsI 			from '../components/AnsI';
import Front_End 		from '../components/Front_End';
import Graphic_Design 	from '../components/Graphic_Design';
import Programming 		from '../components/Programming';

import NavC 			from '../components/NavC';

export default class Project extends Component {
	render() {

	    return (
	      <BrowserRouter>
	        <div>      
	          <NavC />
	          <Switch>
		        <Route path="/Front_End" 		activeClassName="active" 
		        								component={Front_End} 
		        								exact={true} />  
	            <Route path="/Graphic_Design"   component={Graphic_Design} /> 
	            <Route path="/Programming"   	component={Programming} />
	          </Switch> 	                
	        </div>
	      </BrowserRouter>

	    );
  	}	
}
